import React from 'react';
import Box from './Box';

export default function Grid({ gridSize, color }) {
  return (
    <>
      {[...Array(parseInt(gridSize))].map((e, index) => (
        <tr key={index}>
          {[...Array(parseInt(gridSize))].map((element, index) => (
            <Box color={color} key={index} />
          ))}
        </tr>
      ))}
    </>
  );
}
